  /// Method returns the contents of a text file located in
  /// test\assets\{filename}
  static String getAssetFileContents(String fileName) {
    var cDir = Directory.current.path.trim();

    // print('CurrentDir:' + cDir);
    var p = 'squiddy';
    var subString = cDir.substring(0, cDir.indexOf(p) + p.length);
    var path = subString + '/test/assets/$fileName';
    print('Getting data from $path');

    var file = File(path);
    var content = 'errorReadingFile';
    content = file.readAsStringSync();

    return content;
  }
